import React from 'react';

function Post() {
  return ([
    <div className="outer-post">
      <div className="inner-post">
        <img src="/logo192.png" className="col-3"/>
        <p className="col-8">Alex</p>
        <p className="col-1">1m</p>
      </div>
    </div>
  ])
}

export default Post
